Short description:
Established in 1902, Danish manufacturer Stouby is known for its standards of construction and high quality choice of materials. "It all began in a small Danish village, aptly named Stouby, with twenty pounds, half a leather hide, a chaise longue frame, and some linen. That was all Stouby founder, Marius J. Blirup needed to take the first step. And despite the humble conditions and few capital resources, the furniture manufacturer’s desire to create was great. Marius Blirup quickly established himself as a frequent exhibitor at “Købestævne” – the renowned international exhibition of the time. In 1944 son in law Børge Hansen took over and the family business continued. The company grew, and Stouby furniture was exported to all corners of the world. 74 years in the hands of the one family finally came to an end in 1976. Nonetheless Stouby keeps on growing in the same positive spirit with the new ownership structure and 1981 the old factory buildings finally becomes too cramped. The production moves to bigger and better locales in the village of Løsning, where it resides to this day."
\n
\n&nbsp;

This foldable lounge chair was designed by Japanese designer Takeshi Nii in 1958. The chair was named 'NY' after the designer's family name, meaning 'new' in Danish. This chair has won many awards and became a permanent feature in the MOMA collection in 1970.
\n
