Pacific Green actually began in Australia as a company that set out to find a sustainable substitute material which could replace all forest timber in furniture design. They found their answer in the South Pacific with large abandoned plantations of coconut palm trees that were planted commercially in the early 1900s but were no longer fruiting productively.
