The Vitra Standard chair was originally designed by Architect Jean Prouvé in 1934 for the University of Nancy in France. It was engineered for lo<span class="yZlgBd">ngevity with a robust plywood seat and back and thick tubular rear legs to widely spread the weight of the user to the floor. In creating the Standard chair Prouvé made not only one of the most recognisable pieces of mid century design, but also defined an aesthetic approach which informs much of his furniture. Only 1 is available.</span>
